                            <p>Card content</p>
                        </Card>
                    </div>
                    </Col>
                    <Col xs={24} sm={24} md={6} lg={8} xl={8}>                        <div className="site-card-border-less-wrapper">
                        <Card title="Card title" bordered={false} style={{ width: 300 }}>
                            <p>Card content</p>
                            <p>Card content</p>
                            <p>Card content</p>
                        </Card>
                    </div>
                    </Col>
                    <Col xs={24} sm={24} md={6} lg={8} xl={8}>                        <div className="site-card-border-less-wrapper">
                        <Card title="Card title" bordered={false} style={{ width: 300 }}>
                            <p>Card content</p>
                            <p>Card content</p>
                            <p>Card content</p>
                        </Card>
                    </div>
                    </Col>
                </Row>
            </div>
        );
    }
}
export default Services;
